import React from 'react';
import { ThemeProvider } from "@material-tailwind/react"; // Import context provider
import GlobalStyle from './styles/GlobalStyles';
import Navbar from './Components/Navbar';
import LogoAndBentoBoxes from './Components/LogoAndBentoBoxes'; 
import Footer from './Components/Footers';

function App() {
  return (
    <ThemeProvider> {/* Wrap the app with the context provider */}
      <GlobalStyle />
      <Navbar />
      <LogoAndBentoBoxes /> 
      <Footer />
    </ThemeProvider>
  );
}

export default App;
